import React, { useEffect, useState } from "react";
import "../styles/ResultPage.css";

function ResultPage() {
  const [status, setStatus] = useState("processing");

  useEffect(() => {
    // Simulate matching delay
    const timer = setTimeout(() => {
      setStatus("match");
    }, 3000);

    return () => clearTimeout(timer);
  }, []);

  const renderContent = () => {
    if (status === "processing") {
      return <p>üîÑ Matching is under process. Please wait...</p>;
    } else if (status === "match") {
      return (
        <>
          <h2>‚úÖ Match Found!</h2>
          <p><strong>Contact Number:</strong> 9850879136</p>
          <p><strong>Organ Type:</strong> Lung</p>
          <p><strong>Location:</strong> Patiala, Punjab</p>
           <p style={{ marginTop: "1rem", fontWeight: "bold", color: "#f1c40f" }}>
      üôè Thank you for using <span style={{ color: "#e74c3c" }}>Organ Tracker</span>. We're here to save lives.
    </p>
        </>
      );
    } else {
      return (
        <>
          <h2>‚ö†Ô∏è No Matches Found</h2>
          <p>
            We understand the importance of time and how crucial it is. Currently, no matches have been found.
          </p>
        </>
      );
    }
  };

  return (
    <div className="result-container">
      <div className="result-content slide-down">
        {renderContent()}
      </div>
    </div>
  );
}

export default ResultPage;
